import React, { useMemo, useState } from 'react'

const Memo = () => {
    let [add,setAdd]=useState(0)
    let [decrement,setDecrement]=useState(100)
   let mul=useMemo( function mul(){
    console.log("jksa");
    return add*10;
},)
  return (
    <div>
      <h1>useMemo</h1>
      {mul}<br />
      <button onClick={()=>setAdd(add+1)}>Add</button>
      <span>{add}</span><br />
      <button onClick={()=>setDecrement(decrement-1)}>Dec</button>
      <span>{decrement}</span>
    </div>
  )
}

export default Memo
